de:
Während Ihres Aufenthalts werden Sie sich dank der Hydromassagedüsen unseres Whirlpools/Jacuzzi entspannen können. Für sternenklare Nächte ist das Schlafzimmer mit einem Queensize-Bett und einem kleinen begehbaren Kleiderschrank ausgestattet!
Im Wohnzimmer ist der Fernseher... Großbildschirm!
Flucht garantiert...

Diese 27m² große Wohnung ist ideal für eine Flucht zu zweit und wird Sie mit ihrem Komfort begeistern.

Die Unterkunft setzt sich zusammen aus:
- einem Schlafzimmer mit Bett 160/200 (Bettwäsche wird gestellt), einem kleinen Ankleidezimmer ;
- einem angrenzenden Badezimmer mit Badewanne/Balneotherapie und Farbtherapie, Handtuchtrockner (Handtücher werden gestellt) ;
- eine voll ausgestattete Küche (Ceranfeld, Backofen, Mikrowelle, Kaffeemaschine, Toaster, Waschmaschine...) ;
- Separates WC.

Wir haben eine Partnerschaft mit dem Zentrum Marques Avenue und werden Ihnen daher, wenn Sie es wünschen, einen SHOPPING-PASS (10% Rabatt auf große Marken) anbieten, der für einen Tag gültig ist.

en:
During your stay, you'll enjoy a real moment of relaxation thanks to the hydromassage jets of our balneo/jacuzzi and, for starry nights, the bedroom is equipped with a queen-size bed and a small dressing room!
In the living room, the TV is... Big screen!
Escape guaranteed...

This 27m² apartment, ideal for a getaway for 2, will delight you with its comfort.

The accommodation comprises :
- bedroom with 160/200 bed (bed linen provided), small dressing room ;
- en-suite bathroom with bathtub/balneotherapy and chromatherapy, towel dryer (towels provided);
- fully-equipped kitchen (ceramic hob, oven, microwave, coffee maker, toaster, washing machine, etc.);
- Separate toilet.

We are in partnership with the Marques Avenue center, so if you wish, we can offer you a SHOPPING PASS (10% discount on major brands) valid for 1 day.

fr:
Lors de votre séjour, vous profiterez d'un vrai moment de détente grâce aux jets hydromassants de notre balnéo/jacuzzi et ,pour des nuits étoilées, la chambre est équipée d'un lit "Queen Size" et d'un petit dressing !
Dans le salon, la tv est... Grand écran !
Evasion garantie...

Cet appartement de 27m², idéal pour une évasion à 2, vous ravira par son confort.

Le logement se compose de :
- une chambre avec lit 160/200 (les draps sont fournis), un petit dressing ;
- une salle de bain attenante avec baignoire/balnéothérapie et chromothérapie, sèche-serviettes (les serviettes sont fournies) ;
- une cuisine tout équipée (plaque vitrocéramique, four, four à micro-ondes, cafetière, grille-pain, lave-linge...) ;
- W.C. indépendant.

Nous sommes en partenariat avec le centre Marques Avenue et nous vous ferons donc bénéficier, si vous le souhaitez, d'un PASS SHOPPING (réduction de 10% de remise sur de grandes marques) valable pour 1 journée.

es:
