- un dormitorio con una cama de 160/200 (ropa de cama incluida), un pequeño vestidor ;
- un cuarto de baño en suite con bañera/balneoterapia y cromoterapia, radiador toallero (toallas proporcionadas);
- cocina totalmente equipada (vitrocerámica, horno, microondas, cafetera, tostadora, lavadora, etc.);
